import React from 'react';
import './footer.css'

function Footer() {
    return (
        <footer>
            <div className="footer">
                <div className="logo">
                    <p><img src="./Images/Vector (1).svg"/>rundy</p>
                </div>
                <div className="btn-primary nav-btn"><img src="./Images/Vector (2).svg"/>account</div>
            </div>
        </footer>
    )
}

export default Footer;
